    false,nt"url": null,nt"notes": "This narrative report for Tewaukon National
    Wildlife Refuge summarizes refuge activities from January through April of 1960.
     The report begins with a summary of the weather and habitat conditions during
    this period.  Wildlife- including migratory birds, upland game birds, big game animals,
    fur animals, predators, rodents, other mammals, predacious birds, and fish- is also
    covered.  The report includes a refuge development and maintenance section which
    discusses physical developments, plantings, collections, receipts, vegetation control,
    and fires.  Resources management is outlined; grazing, haying, fur harvest, and
    commercial fishing were the primary resources used during this period.  A progress
    report on field investigation and applied research is also provided.  The public
    relations section of the report discusses recreational uses of the refuge, refuge
    visitors, refuge participation, hunting, and violations.  Finally, items of interest,
    photographs, information on easements and WPAs, and N-R forms are provided.",nt"license_title":
